INSERT INTO `zb_cms_addonnews` VALUES (1, '<div class=\"o-article_block pb-15 pb-5@m- o-subtle_divider\">\r\n<div class=\"grid@tl+\">\r\n<div class=\"grid@tl+__cell col-8-of-12@tl+\">\r\n<div class=\"article-text c-gray-1\">\r\n<p>据悉，驰为 HiGame 迷你 PC 配备了英特尔八代酷睿 i5-8305G 处理器，集成了移动版 Radeon Vega M 显卡和 4GB HMB 显存，性能不弱于 Nvidia GTX 1050 。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4412814b010.jpg\" /></p>\r\n<p>存储方面，入门机型从 8GB DDR4 RAM + 128GB M.2 SSD 起跳，消费者可根据实际需要后续升级，此外厂家宣称该机支持 VR 与 AR 系统。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad441284dbe71.jpg\" /></p>\r\n<p>扩展性方面，该机提供了 1&times;雷电 3、5&times;USB 3.0、2&times;HDMI 2.0、2&times;DisplayPort 1.3、以及耳机 / 麦克风插孔。</p>\r\n<p>驰为将于 5 月中旬发起 Indiegogo 众筹，感兴趣的朋友可以拿出 999 美元支持下，且可享受早鸟特惠。</p>\r\n<p>[编译自：<a href=\"https://www.slashgear.com/chuwi-higame-steps-up-from-tablets-laptops-to-mini-pc-market-13527274/\" target=\"_self\">SlashGear</a>]</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"js-notMobileReferredByFbTw\"><footer class=\"o-article_block\">\r\n<div class=\"grid@tl+ mt-n40\">\r\n<div class=\"grid@tl+__cell col-8-of-12@tl+ pb-80@tp+ pb-120@d \">\r\n<div class=\"pb-35 border-top mt-20 mt-35@s pt-35 pt-30@m pt-25@s pb-25@s break-out@s\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</footer></div>', '', 'overseas', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (2, '<p>Chromebox CXI3 价钱实惠，很适合在课堂上使用。但在教育市场之外，它也有着一番用武之地。</p>\r\n<p>宏碁为该系列机型提供了多种配置，入门款搭载的是英特尔赛扬 3865U 处理器，顶配版则是英特尔八代酷睿 i7-8550U 。</p>\r\n<p>存储方面，其提供了 4~16GB RAM + 32~64GB ROM 的组合。扩展方面，则有 2&times;USB 2.1、3&times;USB 3.0、1&times; USB-C 端口，以及 HDMI&nbsp;输出、以太网、音频复合插孔。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44127cc3810.jpg\" /></p>\r\n<p>Chromebox CXI3 支持 VESA 壁挂、垂直摆放、还有一根无线天线。</p>\r\n<p>CXI3 最先由 Chrome Unboxed 在 TigerDirect 上发现，网页给出的发货时间为 4 月 19 号起。赛扬版本售价 279 美元，酷睿 i3 / i5 / i7 版本则是 279 / 469 / 511 / 744 美元。</p>\r\n<p>[编译自：<a href=\"https://www.slashgear.com/acer-chromebox-cxi3-mini-chrome-os-desktops-go-up-for-preorder-12527240/\" target=\"_self\">SlashGear</a>&nbsp;, 来源：<a href=\"https://chromeunboxed.com/acer-chromebox-cxi3-available-shipping-april-19\" target=\"_self\">Chrome Unboxed</a>]</p>', '', 'overseas', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (3, '<p>您可以跟踪您的步数，睡眠，消耗的卡路里以及全天行走的距离，并将所有数据同步到Misfit的移动应用程序。它的防水深度可达50米，可以使用可更换的纽扣电池，使用寿命长达六个月。</p>\r\n<p>混合手表变得越来越流行，因为它们看起来比传统智能手表更时尚。对于那些觉得自己不能持续充电的人来说，它们也特别方便。当然，你必须放弃一些功能，以便照顾它们圆滑的外观，比如阅读和回复邮件或电子邮件的能力。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44125f364e0.png\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44126723cd1.png\" /></p>\r\n<p><img title=\"\" src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4412731d5f2.jpg\" alt=\"\" /><img title=\"\" src=\"https://cdn.fastadmin.net/uploads/20180416/5ad441278753c3.jpg\" /></p>', '', 'overseas', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (4, '<p>大多数消费者可能熟悉UE推出的色彩鲜艳的蓝牙音箱，<strong>但该公司也有一系列定制入耳式耳机，UE刚刚推出了一款新的顶级旗舰机型：2,200美元的UE Live。</strong>UE Live耳机是该公司以前的旗舰UE18 Pro型号的进化版本，将每个耳机的扬声器数量从6个增加到8个，共计6个平衡电枢，一个True Tone Plus驱动器和一个6mm钕制动态扬声器，以提供更好的声音。</p>\r\n<p>但是，这些改进需要付出代价：UE Live耳机的起价为2,199美元，自定义选项价格可能会更高。</p>\r\n<p>Ultimate Ears的定制入耳式耳机倾向于专业音乐家在工作室或舞台上使用，而UE Live也不例外。 Ultimate Ears表示，新款耳机专为在音乐节，舞台和体育场举办音乐会的音乐家而设计 - 尽管如果您只是在家里听音乐，他们听起来也会非常出色。</p>\r\n<p>与UE Live一起，Ultimate Ears还宣布推出Ultimate Ears 6 PRO，这是一款价格为699美元的入耳式监听音箱，该监听音箱专为鼓手，贝斯手，DJ和嘻哈音乐家设计，并配有两个动态驱动程序中音和低音。</p>\r\n<p>这两款耳返将于2018年5月开始发货。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad441258ab510.png\" alt=\"QQ图片20180413011632.png\" /></p>', '', 'overseas', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (5, '<p>想必大家都遇到过这样尴尬的事情：家里有很多电池，用的时候也分不清哪个有电、哪个没电，扔了又怕浪费。于是旧的不丢掉，新的买来用，这样家里的电池越积攒越多，造成恶性循环。而现在，南孚带来了一款全新产品&mdash;&mdash;南孚测电器装电池，包含南孚测电器和南孚碱性电池，轻轻松松测一测，电池电量一目了然。</p>\r\n<p>而且测电器5号电池和7号电池均可以测量，一器双用。</p>\r\n<p>这款南孚测电器体积非常小巧，仅有<a href=\"http://aos.prf.hn/click/camref:100lcC/creativeref:305226\" target=\"_blank\" rel=\"noopener\" data-link=\"1\">iPhone</a>&nbsp;8手机的四分之一大小（长60mm、宽36mm、厚12mm）。测电器通体白色，侧边有纹路处理，方便持握。</p>\r\n<p>正面有&ldquo;南孚聚能环&rdquo;字样、电池放置正负极标志、电池剩余电量指示灯；背面有测试结果说明&mdash;&mdash;3灯全亮表示电量充足，2灯为还能用，1灯为建议更换，不亮则代表没电，显示结果简单易懂，学习成本几乎为0。</p>\r\n<p>对于正在使用的电池，我们也可以用南孚测电器去测试它的剩余电量，以达到心中有数的目的。比如家里孩子玩的玩具车，对于电池电量要求比较高，我们可以在玩具使用一段时间后，测试电池剩余电量，若指示为&ldquo;2灯亮&rdquo;及以下时，将该电池换到那些功率小的玩具上继续使用，让电池不至于浪费，物尽其用。</p>\r\n<p>最关键的是，这个测电器是南孚免费赠送的。从18年开始，南孚将狂送150万个测电器。只要在线下商超或者线上旗舰店购买南孚大包装，就能免费获得测电器。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad441222f2370.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad441229f34b1.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44123130772.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44123724f83.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44123d13154.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad441242fa2e5.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44124821496.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44124d91187.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4412530fd08.jpg\" /></p>', '', 'domestic', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (6, '<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44121af36d0.jpeg\" alt=\"acuvue-oasys-tinting-contacts-1.jpeg\" /></p>\r\n<p>据了解，这款叫做Acuvue Oasys With Ttransitions的隐形镜片由强生和Transitions Potical合作研发。除了像普通隐形眼镜一样能够帮助佩戴者看清东西而且还能在光线条件发生变化时做出快速、无缝的调整，它能过滤掉蓝光并阻断紫外线的进入。</p>\r\n<p>不过强生强调，这款隐形眼镜并不是为取代太阳镜而开发，毕竟它们不能覆盖住整个眼睛。</p>\r\n<p>据悉，Acuvue Oasys With Transitions隐形眼镜已经获得美国食品与药物管理局批准，其佩戴周期为2周，预计会在今年上半年进入市场。</p>', '', 'domestic', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (7, '<p>据 Variety 报道，FCC 辐射实验室刚刚证实了一副来自 Snap 的新眼镜。<strong>今日曝光的这款穿戴设备的文档称，这是一款由 Snap Inc. 制作的穿戴式视频拍摄装置。从印刷标签来看，其品牌名称为 Spectacles，型号为 Model 002 。</strong>尽管文件中所附的大部分内容都以保密为由被遮掩，但还是可以知道它支持低功耗蓝牙 4.2 和 802.11ac Wi-Fi 。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44121495860.jpg\" alt=\"DSC_2124_2040b.0.jpg\" /></p>\r\n<p>2016 年发布的初代 Spectacles 眼镜</p>\r\n<p>上个月的时候，Cheddar 爆料了两款即将到来的 Spectacles 眼镜。其中一款是计划在 2018 年发布的二代产品，改进了性能并修复了 bug 。</p>\r\n<p>另外还有一款计划在 2019 年发布的第三代产品，据说它配备了 2 个摄像头、支持 GPS、售价 300 美元。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4412189f8c1.jpg\" alt=\"screenshot_2018_04_11_08.31.06_1024.png.jpg\" /></p>\r\n<p>2016 年发布的初代 Spectacles 在营销上一度相当成功，很多人排着长队、甚至愿意出高价购买一副。即便炒作的热度很快就消散，但至少为该公司赚到了 4000 万美元。</p>\r\n<p>从 FCC 文件来看，Spectacles 二代产品的发布应该无需等待太久。当然，通过 FCC 认证也不见得产品会真的上市。</p>\r\n<p>[编译自：<a href=\"https://www.theverge.com/circuitbreaker/2018/4/11/17223426/snapchat-spectacles-second-generation-model-002\" target=\"_self\">TheVerge</a>]</p>', '', 'overseas', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (8, '<p>云存储服务商Dropbox今日宣布，由于投资者需求强劲，现将IPO(数次公开招股)发行价区间调高2美元。上周一，Dropbox宣布将IPO发行价区间定为每股16美元至18美元，最高融资6.48亿美元，公司市值将达到约71亿美元。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44120f16870.jpg\" /></p>\r\n<p>但Dropbox今日宣布，由于投资者需求强劲，现将发行价区间调高2美元，至每股18美元至20美元。这意味着Dropbox此次IPO最多将融资7.2亿美元，公司市值将达到约78.5亿美元。</p>\r\n<p>业内专家杰伊&middot;瑞特(Jay Ritter)称，与Box等竞争对手相比，Dropbox最初给出的IPO发行价区间确实有些保守。</p>\r\n<p>虽然调高了发行价区间，但Dropbox当前估值仍低于2014年100亿美元的估值。</p>\r\n<p>昨日就有报道称，Dropbox IPO股票已被超额认购，表明今年市场对第一大科技股的需求十分旺盛。</p>\r\n<p>Dropbox成立于2007年，上个月提交了IPO招股书。Dropbox计划在纳斯达克上市，证券代码为&ldquo;DBX&rdquo;。</p>', '', 'overseas', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (9, '<p>著名云存储服务提供商Dropbox在上市交易首日股价大涨36%，开盘定价为21美元每股，在当日最高时达到31.6美元每股，最终以28.48美元每股的价格收盘，现在市值超过120亿美元。可以明显看出公开市场投资者十分看好Dropbox这家主营业务为云存储服务和内容协作平台的公司。Dropbox最先对自己股价的预期是16到18美元每股，后来提升到18到20美元每股。而由于上市交易首日表现出色，超过了2014年私募时100亿美元的估值。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44120cd28e0.jpg\" /></p>\r\n<p>在2017年，Dropbox实现营收11亿美元。较2016年的8.45亿美元和2015年的6.04亿美元的年度总营收增长不少。不过，Dropbox至今尚未实现盈利，去年净亏损为1.12亿美元。该数字在2016年和2015年分别是2.1亿美元和3.26亿美元，可以看出其净亏损在逐年减少。其从每个付费用户获得的平均收入为111.91美元。</p>\r\n<div id=\"cbhahaha\" class=\"otherContent_01\">&nbsp;</div>\r\n<p>由于Dropbox采用的是免费+付费模式，既有面向消费者的业务也有面向企业的业务。Dropbox曾表示其所有5亿注册用户中只有1100万为其产品付费。</p>\r\n<p>著名风投公司红杉资本合伙人、Dropbox董事会成员布莱恩&middot;施莱尔（Bryan Schreier）称：&ldquo;Dropbox结合了一家消费者公司该有的规模和影响力和一家软件公司该有的长期收益的优势。&rdquo;他表示现在正是Dropbox上市的最佳时机，因为&ldquo;其业务规模和现金流都已经达到一定程度，足以支撑其上市计划&rdquo;。</p>\r\n<p>作为Dropbox的早期投资机构，红杉资本如今持有Dropbox 23.2%的股份。另一家风投公司Accel是第二大机构股东，持有5%的股份。Dropbox创始人兼首席执行官德鲁&middot;休斯敦（Drew Houston）持有公司25.3%的股份。</p>\r\n<p>投资机构Greylock Partners也拥有少量Dropbox股份，其合伙人约翰&middot;里利（John Lilly）说：&ldquo;之所以投资Dropbox，是因为德鲁和他的团队对未来的工作模式有着清晰的认识，并打造了一个满足现代生产力需求的产品。&rdquo;</p>\r\n<p>不过，目前市场上有大量与Dropbox相似的产品。Dropbox称：&ldquo;内容协作平台市场竞争激烈且变化很快。在云存储业务方面，我们面临来自<a href=\"http://t.cn/R61I7ap\" target=\"_blank\" rel=\"noopener\" data-link=\"1\">亚马逊</a>、苹果、谷歌、和<a href=\"http://clkde.tradedoubler.com/click?p=235167&amp;a=2355305&amp;g=21862034\" target=\"_blank\" rel=\"noopener\" data-link=\"1\">微软</a>公司同类产品的竞争。而在内容协作市场则有来自Atlassian、谷歌、和微软公司的竞争。我们与Box的竞争则主要局限在面向大型企业用户的云存储服务领域。&rdquo;</p>\r\n<p>Box是一家从事与Dropbox类似业务的公司，经常与Dropbox一起被提到。不过Box商业模式与Dropbox不同，其更专注于企业用户。在Dropbox上市首日，Box股价下跌了8.2%。</p>', '', 'overseas', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (10, '<p><strong>云存储公司Dropbox周五向美国证券交易委员会（SEC）提交了IPO（首次公开招股）申请文件，寻求筹集5亿美元资金。</strong>Dropbox的IPO交易长期以来备受市场期待，该公司四年前在私募投资市场上的估值就已高达100亿美元。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44120825a50.jpg\" /></p>\r\n<p>这家硅谷创业公司成立于2007年。在IPO申请文件中，该公司披露信息称其过去三年的营收分别为6.038亿美元、8.448亿美元和11.1亿美元，而亏损则从3.259亿美元渐次收窄到了2.102亿美元和1.117亿美元。</p>\r\n<p>据《华尔街日报》报道，Dropbox此前通过私募融资回合已经筹集到6亿美元资金。在2014年1月进行的最后一个融资回合中，该公司估值达100亿美元。</p>\r\n<div id=\"cbhahaha\" class=\"otherContent_01\">&nbsp;</div>\r\n<p>Dropbox计划在纳斯达克挂牌上市，股票代码为&ldquo;DBX&rdquo;。共有12家银行将担任该公司IPO交易的承销商，其中主承销商是高盛集团和摩根大通。</p>\r\n<p>文件还披露信息称，Dropbox去年每付费用户平均收入为11.91美元，高于2016年，但低于2015年；注册用户总数达5亿人，自2017年初以来的新注册用户人数为1亿人；付费用户总数达1100万人以上；毛利率为67%。</p>\r\n<p>Dropbox此前就已秘密向美国证券交易委员会提交了IPO申请文件，后者在周五对外公布了该文件。文件显示，Dropbox联合创始人及CEO德鲁&middot;休斯顿（Drew Houston）持有24.4%具备投票权的股票，风投公司红杉资本（Sequoia Capital）持有24.8%股权。</p>\r\n<p>受研发预算扩大的影响，Dropbox的支出有所增长，但该公司已在2016年实现了正向的自由现金流。很多云公司都依靠企业销售团队来获取收入，但Dropbox则与众不同，该公司90%以上营收都来自购买自己的订阅服务的用户。不过，这家仍未摆脱亏损的公司仍面临约17亿美元的合同义务，如租约和未偿还债务等。</p>\r\n<p>另外，Dropbox还面临着严峻的竞争压力，其各方面业务与<a href=\"http://t.cn/R61I7ap\" target=\"_blank\" rel=\"noopener\" data-link=\"1\">亚马逊</a>、苹果公司、谷歌和<a href=\"http://clkde.tradedoubler.com/click?p=235167&amp;a=2355305&amp;g=21862034\" target=\"_blank\" rel=\"noopener\" data-link=\"1\">微软</a>等科技巨头之间存在竞争关系。</p>\r\n<p>来自于IPO交易的收入将被用于融资一项扩张计划，内容包括将更多用户升级至订阅用户，以及扩大与第三方软件之间的整合等。</p>\r\n<p>在Dropbox的IPO申请文件公布以后，其竞争对手Box的股价上涨2.8%。Dropbox曾五次入选&ldquo;CNBC Disruptor 50&rdquo;榜单，该榜单每年公布一次，评选出50家最有影响力、最具有开拓精神的创业公司。</p>', '', 'overseas', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (11, '<p>通用电气（GE）为推广Predix云平台的应用开发，在国内推出首期\"Predix星火计划\"，以奖励基于该平台的工业互联网开发者。首期有4家企业获奖，将进驻GE孵化器并获得技术支持和潜在投资机会。</p>\r\n<p><img title=\"\" src=\"https://cdn.fastadmin.net/uploads/20180416/5ad441204c1c20.png\" /></p>\r\n<p>参与该计划的团队需基于GE Predix平台，开发适合工业领域的资产绩效管理（APM）应用，用于工业企业实时、安全地收集和分析数据，增加正常运行时间、降低成本、减少运营风险。</p>\r\n<p>GE Predix是一个基于Cloud Foundry(CF)的云平台，专攻制造业。跟Azure，AWS的PaaS服务相比，Predix的优势在于对于工业数据的导入做了专门优化。</p>\r\n<p>2017年\"Predix星火计划\"采用提名邀请，共有16家GE合作伙伴及创业公司提交了内容涵盖包括能源、医疗、设备制造等领域的工业应用项目方案。</p>\r\n<p>获奖企业中，广采科技由思科参与投资，提供货物与集装箱的全球跟踪服务。实视科技面向汽车、装备制造等客户开发用于智能眼镜的AR应用。华瑞特信息主要开发企业业务管理流程整合应用。华中思能主要针对电力企业开发节能减排、运营优化、故障诊断应用。</p>\r\n<p>四家获奖企业将获得的资源支持包括，进驻位于上海的GE数字创新坊孵化1个月、期间将有GE技术团队支持和GE创投部门考察进一步投资机会。</p>', '', 'local', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (12, '<p><strong>据外媒报道，Cloudflare 公司正将其业务拓展到网站和云应用之外的互联网安全领域。</strong>此前，Cloudflare 帮助过企业屏蔽恶意流量，并且让它们的线上内容加载得更加迅速。而根据今日披露的内容，这项新服务旨在保护那些在公共网络背景下运行的联网基础设施，涵盖了从企业内部电子邮件服务器、到领域内部署的联网设备等各个方面。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411fb836c0.png\" alt=\"cloudflare.png\" /></p>\r\n<p>尽管其中有一些是在孤立的网络中运行，但又许多这样的系统是通过开放的 Web 进行通讯的。如此一来，它们就和网站一样，很容易受到分布式拒绝服务攻击的影响。</p>\r\n<p>Cloudflare 表示，Spectrum 允许企业通过相同的 DDoS 缓解功能（其一直为在线服务提供的那种），来应付这些威胁。</p>\r\n<p><strong>对于这些攻击的抵御，Cloudflare 的解决方案其实很简单：</strong></p>\r\n<blockquote>\r\n<p>当流量突然激增的时候，系统会猜测事件可能由 DDoS 引发，然后将请求转发到自家的 150 个数据中心网络。</p>\r\n<p>Cloudflare 的基础设施相当强大，能够承受住巨量的攻击而不被斩断。</p>\r\n</blockquote>\r\n<p>当然，这么做还有另一个好处 &mdash;&mdash; 即便企业没有一个内置的连接保护机制，Spectrum 服务也允许企业对系统传输的数据进行加密。</p>\r\n<blockquote>\r\n<p>对企业来说，Cloudflare 提供的这项服务极具吸引力。作为附加措施，Spectrum 还提供了 Cloudflare 防火墙工具的集成。</p>\r\n</blockquote>\r\n<p>后者可以自动阻止某些 IP 地址的流量，比如那些被网络安全机构标记的恶意来源。</p>\r\n<p>Cloudflare 早就声称担负了 10% 的全 Web 流量，此前该公司还推出了一项免费的系统服务，承诺让人们浏览的互联网更具隐私。</p>\r\n<p>[编译自：<a href=\"https://siliconangle.com/blog/2018/04/12/cloudflare-moves-beyond-web-services-new-spectrum-security-service/\" target=\"_self\">SiliconAngle</a>]</p>', '', 'overseas', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (13, '<p>当英特尔上周推出更多更多 Coffee Lake CPU 和配套主板时，传说中的 Z390 芯片组却意外缺席了。<strong>不过有眼尖的人们发现，主板厂商映泰（Biostar）在自家 B360 Racing GT5 手册中，竟然清楚地列明了另一款名叫&ldquo;Z390GT5&rdquo;主板的存在。</strong>作为一个二线品牌，映泰的产品主打平价而不是古怪的设计。不过它与现有的 Z370 系列没有太大差别，而且最高支持的 CPU TDP 也仅为 95W，刚好够酷睿 i7-8700K 使用而已。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411ecab1c0.jpg\" alt=\"Biostar-Z390-Racing-GT3-1000x658.jpg\" /></p>\r\n<p>此前有传闻称，某款八核 Coffee Lake 芯片的 TDP 可能超过这个数值。若真如此，Z390 芯片组存在的意义，可能就是比 H370 系列多一些 PCIe 通道、内建 USB 3.1 Gen 2、以及 CNVi Wi-Fi 支持。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411f2854d1.png\" alt=\"z390gt5.png\" /></p>\r\n<p>映泰的公告中并未详细给出这些特性，所以仍有待证实。去年的泄露似乎表明，该公司的 Z390 芯片组会包含自家的音频硬件，但这块板子仍然采用了老旧的瑞昱（Realtek）编解码器。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411f72b3d2.png\" alt=\"Biostar-Z390-GT5-layout.png\" /></p>\r\n<p>[编译自：<a href=\"https://techreport.com/news/33492/rumor-biostar-manual-tips-off-the-existence-of-a-z390-chipset\" target=\"_self\">TechReport</a>&nbsp;, 来源：<a href=\"https://videocardz.com/75858/biostar-confirms-z390-racing-gt3-gt5-motherboards\" target=\"_self\">VideoCardz</a>]</p>', '', 'overseas', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (14, '<p>4 月 11 日，Valve 宣布旗下著名的 PC 游戏发行平台 Steam 会推出新的用户数据隐私安全措施。今后玩家们可以选择隐藏你的游戏库内容，也可以隐藏你的活动细节，具体到最近收藏什么游戏，买了什么游戏，玩了什么游戏以及在某游戏上花了多少小时等等。</p>\r\n<p>此前，这些信息全部是公开的，不仅你的好友可以看到，发表评论的时候社区用户可以看到，而且第三方可以采用 Steam API 轻而易举的获得，那些 PC 游戏数据提供商（Steam Spy 之类）就是依靠这些用户数据提供服务的。</p>\r\n<p>新的隐私措施实行后，不管是其他用户还是第三方，将无法轻易获取这些数据。也就是说，如果你想要隐藏，那就永远不会有第三者知道你在某成人视觉小说游戏上面花了多少时间。</p>\r\n<div id=\"cbhahaha\" class=\"otherContent_01\">&nbsp;</div>\r\n<p>这对 Steam 用户当然是个不错的消息，而受影响最大的是 Steam Spy 这种收集并分析数据的第三方。Steam Spy 说起来大家都不会太陌生，很多相关新闻也会引用 Steam Spy 的数据报告。他们根据过滤器筛选数据，然后将 Steam 上的游戏统计呈现给更多人浏览，但随着 Valve 关闭 Steam 可用库数据，包括 Steam Spy 在内的第三方可能都要面临倒闭。</p>\r\n<p>目前还未清楚 Valve 有没有其他替代方案，用以让第三方继续提供数据服务，或者单独推出面向开发者的数据统计工具。</p>\r\n<p>Steam Spy 的创始人 Sergey Galyonkin 在接受外媒采访时说，&ldquo;如果他们真的想遵守法律，应该隐藏所有的个人资料信息。目前他们有默认情况下暴露的敏感信息，只有游戏库被隐藏。这并不合理。&rdquo;默认情况下，你的 Steam 个人资料仍会向所有人显示识别信息，例如你的社交媒体帐户。</p>\r\n<p>Steam Spy 创始人提到的&ldquo;法律&rdquo;，其实是 5 月 25 日生效的欧盟&ldquo;GPDR&rdquo;，全称&ldquo;通用数据保护条例&rdquo;，欧盟的新规定要求公司加密所有&ldquo;非公开信息&rdquo;。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411e749b30.jpg\" /></p>\r\n<p>所以我们可以认为 Valve 做出这一决定并不绝对与近期爆发的 Facebook 数据泄露事件有关，但是这一事件肯定推动了 G 胖尽快落实自己的隐私安全措施。在这个时期，恰到好处地透露给用户&ldquo;我们是一家坚定保护用户信息安全的公司&rdquo;这样的信息，就是一颗很好的定心丸了。</p>\r\n<p>可以想见 Facebook 数据泄露以及后来的 Cambridge Analytica 丑闻给各大科技公司带来了怎样的压力。尽管 Steam 光是卖游戏就能保证自己足够赚钱，看起来完全没有出卖数据的必要，Steam Spy 上收集的游戏数据和用户游戏行为，于操弄政治的 Cambridge Analytica（剑桥分析公司）之流也产生不了什么价值，但谁敢说有朝一日不会因金钱诱惑发生与 Facebook 丑闻类似的事情呢？</p>\r\n<p>Valve 宁愿让一家第三方数据服务商去死，也不会冒着 G 胖走进国会接受听证的风险，无数玩家还在苦苦等待《半条命3》呢。放整个业界来讲，不管是哪家公司，都不敢再承担一次这样的&ldquo;风暴潮&rdquo;。</p>\r\n<p><strong>Facebook的教训</strong></p>\r\n<p>Facebook 身处争议漩涡，人们的抗议达到了顶峰。有人怀疑它的用处，有人直接否认它的用处，在当前的信任危机下，一切情绪都持续放大，公司和公司的使命被极端质疑。Facebook的市值自从指控以来已经减少超过500亿美元，情况简直糟糕。</p>\r\n<p>上个月，根据纽约时报、卫报曝光 Facebook 发生了严重的数据泄露，波及用户有 5000 万人之多，外泄信息被商业公司利用建立成性格模型，用来操纵了 2016 年的美国大选。</p>\r\n<p>Facebook 日前承诺 ，对于受 Cambridge Analytica 数据丑闻影响的用户，该公司会专门进行通知。毫无疑问，自 Facebook 泄密丑闻曝光以来，许多人都在等待这样的消息。随着马克&middot;扎克伯格（Mark Zuckerberg）在美国参议院听证会上作证，更多关于数据丑闻的细节浮出水面。</p>\r\n<p>在过去一年的动荡中，Facebook 广告的基本理念，即基于用户隐藏性格特征来投放广告，已被证明是一种恶意利用用户信息，且容易遭到滥用的做法。Facebook 对此的回应与其他科技行业巨头的态度类似：感到震惊，向用户保证这绝对不是有意的行为，以及承诺采取行动。</p>\r\n<p>扎克伯格面对数不清的镜头提出的观点也颇有意思，他说经过此事希望美国数据处理和隐私规则能发生演化，其中包括直接呼吁放松监管来避免美国公司落后于中国竞争对手&mdash;&mdash;在西方人的脑子里，中国好像是毫无个人信息隐私而言的地方。</p>\r\n<p>他谈到了&ldquo;让人们完全控制&rdquo;自己所分享内容的概念，声称这是&ldquo;Facebook 最重要的原则&rdquo;。</p>\r\n<p>&ldquo;你在 Facebook 上分享的所有内容都归你自己所有，而且你完全控制着谁能看到它以及如何进行分享。此外，你还可以随时删除它。&rdquo;扎克伯格说道，并未提及该公司在其发展早期阶段距离这样的原则有多遥远。</p>\r\n<p>国外媒体纷纷认为扎克伯格的辩解不太含蓄，因为其他平台泄漏数据的规模都比不上 Facebook，而用户是否会买扎克伯格这个账还有待观察。</p>\r\n<p><strong>怼怼苹果 更开心</strong></p>\r\n<p>一般大公司的 CEO 都充当了企业发言人的角色，经常在各种访谈、社交媒体上发表自己的言论，甚至是向竞争对手开炮。</p>\r\n<p>Facebook 因为用户隐私泄露被网友围攻的时候，苹果 CEO 库克自然也被媒体围着追问对这件事情的看法，库克的回答十分尖锐：</p>\r\n<p>&ldquo;对我们来说用户隐私等同于用户的权利和公民自由，但是 Facebook 是一个免费服务，所以用户在这个服务中反而成了卖给广告商的商品，如果苹果这么做，我们将能赚到很多钱，但苹果最好不、也永远不会这么做。&rdquo;</p>\r\n<p>在隐私方面，苹果一直奉行着严格的标准，而且它自己也一直以这种严格为傲，苹果的隐私方案多次承诺&ldquo;我们不会根据你的电子邮件内容或网页浏览习惯来建立档案，然后出售给广告商。我们不会用你存放在&nbsp;<a href=\"http://aos.prf.hn/click/camref:100lcC/creativeref:305226\" target=\"_blank\" rel=\"noopener\" data-link=\"1\">iPhone</a>&nbsp;或 iCloud 上的信息来赚钱。&rdquo;</p>\r\n<p>他们有时甚至把美国政府搞得灰头土脸。在对发生在加利福尼亚州圣贝纳迪诺的大规模枪击案调查期间，苹果拒绝帮助美国联邦调查局解锁一名嫌犯的 iPhone，甚至不惜为此与政府对簿公堂。解锁嫌犯的 iPhone 要求开发专门软件，苹果认为影响所有用户手机的安全功能。美国司法部随后在没有苹果帮助的情况下自己找到解锁嫌犯手机的方法。</p>\r\n<p>直到现在，FBI 还在想方设法的要破解 iPhone。库克的态度肯定是&mdash;&mdash;抗争到底。</p>\r\n<p>当然，苹果对用户隐私的严格保护也是经过惨痛教训的，2014 年好莱坞女星照片泄露事件波及众多大腕，在全球引起了极大的注意，让苹果和 iCloud 都摊上了大事。虽然那一次隐私泄露是由于黑客行为，和今天说的用户数据泄露、滥用态度有所区别，但那一次事件让所有人开始思考应该如何给个人信息添加更严实的门锁，更谨慎细致地保护云端安全。</p>\r\n<p>所以，记住这些教训，可以让苹果和 Facebook 们以后不再那么惨痛。这次也一样。</p>', '', 'local', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (15, '<p>今天，W3C和FIDO联盟标准机构宣布，Web浏览器正在构建一种新的登录方式。这款名为WebAuthn所呈现的新开放标准将在最新版本的Firefox中得到支持，并将在未来几个月发布的Chrome和Edge的版本中得到支持。<strong>这是多年来的最新举措，目的是让用户远离密码，转向更安全的登录方式，如生物识别和USB令牌。</strong></p>\r\n<p>该系统已经在谷歌和Facebook等主要服务上就位，在那里你可以使用符合FIDO标准的Yubikey设备登录。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411e3a7db0.png\" alt=\"Security-Key-by-Yubico.png\" /></p>\r\n<p>WebAuthn将无疑将加速安全登录的实现，无论是将这些技术作为备用登陆方式，还是完全取代密码。随着更多的开源代码为新标准而编写出来，开发者将更容易实现新的登录方式。</p>\r\n<p>&ldquo;以前，USB令牌登陆的模式只运用于谷歌、<a href=\"http://clkde.tradedoubler.com/click?p=235167&amp;a=2355305&amp;g=21862034\" target=\"_blank\" rel=\"noopener\" data-link=\"1\">微软</a>和Facebook等大公司，&rdquo;参与Firefox工作的Selena Deckelmann说。&ldquo;现在，通过WebAuthn，更多的用户将能够体验安全登录。&rdquo;</p>\r\n<p>因为FIDO标准是建立在零知识的基础上的，所以没有一串字符可以保证对一个账户的访问，这使得传统的钓鱼攻击变得更加困难。它为有安全意识的用户和企业提供了保护自己的重要途径。随着越来越多的服务转向支持更安全的登录方式，FIDO-ready用户的数量会越来越多。</p>\r\n<p>Deckelmann说：&ldquo;它能真正的规避安全隐患，但现在我们还没到那一步，这将是我们的美好未来。&rdquo;</p>', '', 'overseas', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (16, '<p>Github 去年推出的<a href=\"https://www.oschina.net/news/90737/security-alerts-on-github\">安全警告</a>，极大减少了开发人员消除 Ruby 和 JavaScript 项目漏洞的时间。<strong>GitHub 安全警告服务，可以搜索依赖寻找已知漏洞然后通过开发者，以便帮助开发者尽可能快的打上补丁修复漏洞，消除有漏洞的依赖或者转到安全版本。</strong></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411db71750.png\" alt=\"36836206-97565a64-1ced-11e8-990f-d12cb4b003e5.png\" /></p>\r\n<p>根据 Github 的说法，目前安全警告已经报告了 50 多万个库中的 400 多万个漏洞。在所有显示的警告中，有将近一半的在一周之内得到了响应，前7天的漏洞解决率大约为30%。实际上，情况可能更好，因为当把统计限制在最近有贡献的库时，也就是说过去90天中有贡献的库，98%的库在7天之内打上了补丁。</p>\r\n<p>这个安全警报服务会扫描所有公共库，对于私有库，只扫描依赖图。每当发现有漏洞，库管理员都可以收到消息提示，其中还有漏洞级别及解决步骤提供。</p>\r\n<p>安全警告服务现在只支持 Ruby 和 JavaScript，不过 Github 表示 2018 年计划支持 Python。</p>', '', 'domestic', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (17, '<p>AV-TEST公布了2018年1~2月杀毒软件的最新测试情况，稍稍有点不接地气的是，基于Windows 10企业版平台。排名第一的依然是铁打的卡巴斯基，3个满分总计18分无悬念。不过，这次Symantec和Trend Micro也是18满分，令人刮目相看。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411cec01d0.jpg\" /></p>\r\n<p><a href=\"http://img1.mydrivers.com/img/20180329/989bd28efaea4c2f831fe5f2405b4b8b.jpg\" target=\"_blank\" rel=\"noopener\" data-index=\"1\" data-lightbox-gallery=\"cbc-gallery\"><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411d587af1.jpg\" /></a></p>\r\n<p>Bitdefender稍稍遗憾，以0.5分的差距（易用性非满分）排名第二，第三名17分也有3名，分别是你Avast、McAfee和<a href=\"http://clkde.tradedoubler.com/click?p=235167&amp;a=2355305&amp;g=21862034\" target=\"_blank\" rel=\"noopener\" data-link=\"1\">微软</a>。</p>\r\n<p><strong>是的，你没有看错，微软自带的Defender居然防护力满分和性能/易用性两个5.5分并列第三名。</strong></p>\r\n<p>这次排名最后的是F-Seecure，仅拿到14.5分。</p>', '', 'domestic', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (19, '<p>今日，谷歌分享了 Semantic Experiences，在博客中展示了两大关于自然语言理解的互动工具。Talk to Books 是一个可以从书中的句子层面搜索书籍的全新检索模式；另一个互动内容则是 Semantris，一个由机器学习驱动的单词联想游戏。</p>\r\n<p>地址：</p>\r\n<div id=\"cbhahaha\" class=\"otherContent_01\">&nbsp;</div>\r\n<p><a href=\"https://research.google.com/semanticexperiences/\" target=\"_blank\" rel=\"noopener\">https://research.google.com/semanticexperiences/</a></p>\r\n<p>谷歌还发布了「通用语句编码器」（Universal Sentence Encoder），更加详细地呈现了上述示例所使用的模型；当然，谷歌还为开源社区提供了一个预训练的 TensorFlow 模型，开发者可以测试自己的句子及短语编码。</p>\r\n<p>地址：</p>\r\n<p><a href=\"https://tfhub.dev/google/universal-sentence-encoder/\" target=\"_blank\" rel=\"noopener\">https://tfhub.dev/google/universal-sentence-encoder/</a></p>\r\n<p>自然语言理解在近年已经有了极大进步，这得益于词向量（word vectors）的发展，这一技术使算法能根据实际语言使用的例子来学习单词之间的关系。这些向量模型根据概念和语言的等价性、相似性或关联性，将语义相似的词或短语投影到临近点。</p>\r\n<p><strong>建模方法</strong></p>\r\n<p>谷歌拓展了在向量空间中表征语言（language）的构想，这一想法通过为像完整句子或段落为代表的较大语言块创建向量来实现。语言是由具有概念的层次结构组成的，因此团队采用模块的层次结构来构建向量，每一模块都要考虑与不同时间尺度序列所对应的特征。各种类型的关系，如关联、同/反义、部分/整体等都可以用向量空间语言表示。团队在论文《Efficient Natural Language Response for Smart Reply》有更多介绍。</p>\r\n<p>论文地址：</p>\r\n<p><a href=\"https://arxiv.org/abs/1803.11175\" target=\"_blank\" rel=\"noopener\">https://arxiv.org/abs/1803.11175</a></p>\r\n<p>Talk to Books</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411b4c3960.jpg\" /></p>\r\n<p>以往我们在检索书籍时，通常会从书名、作者、主题等表面标签入手。而谷歌发布的「Talk to Books」可以为用户提供一种检索书籍的全新方法。用户只需要做一段相关描述，或是提一个相关的问题，那么 Talk to Books 可以在不依赖关键词匹配的情况下，从超过 10 万本书籍中检索所有句子，并根据句子层面的语义，找到能匹配用户陈述或问题的句子。从某种意义上来说，Talk to Books 是一种用户与书「交谈」的新模式，系统给出的回答也能帮助用户确定自己是否对相关主题感兴趣。</p>\r\n<p>模型在正式发布前经历了超十亿次的对话训练，以打磨更好的用户体验&mdash;&mdash;对用户的提问或陈述给出更加合适的回答。这一方式相比起普通的谷歌检索，可能会帮助用户找到一些更有趣的书籍，特别是在关键字搜索中并不会显示的一些结果。</p>\r\n<p>不过，这一模型还有更多的改进空间，比如搜索范围局限在句子层面上，而不是段落，因此可能会产生「断章取义」的情况。另外，因为只看某一句子的匹配程度，这也可能导致某些众所周知的、「符合口味」的书并不会出现在检索结果的前列。谷歌团队此举，更多的是希望帮助人们以一种新的探索方式，发现不曾料想过的作者和书名，竟然会有读者感兴趣的内容。</p>\r\n<p>地址：<a href=\"https://books.google.com/talktobooks\" target=\"_blank\" rel=\"noopener\">https://books.google.com/talktobooks</a></p>\r\n<p>Semantris</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411c8b9211.gif\" /></p>\r\n<p>Semantris 是一个由相同技术驱动的单词联想游戏。屏幕上会呈现所有单词，用户可以输入某个单词，随即系统会根据屏幕上单词与用户输入单词的关联程度进行重新排序。不论是近义词、反义词还是相近概念，系统都能找到对应的排序模式。</p>\r\n<p>如图所示，用户输入「Photo」时，最顶部的「Camara」因为与输入单词的关联最为紧密，因此会更替排序调整到第一位「消掉」。这确实是一个锻炼联想能力的好机会，此外还有限时模式和不限时模式供用户体验。</p>\r\n<p>地址：<a href=\"https://research.google.com/semantris\" target=\"_blank\" rel=\"noopener\">https://research.google.com/semantris</a></p>\r\n<p>相信在这两个工具的驱动下，人工智能能够与用户更好地进行交互学习，并且帮助人类在现实生活中更好地理解科技，使用科技，并受惠于科技。</p>', '', 'domestic', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (20, '<p><strong>针对新兴市场，Google希望通过Google Go轻量级应用帮助身处网络速度慢、流量资费高昂地区的用户获得更流畅的网络搜索体验</strong>。现在谷歌正向在26个撒哈拉以南非洲国家/地区推广，Google Go轻量级应用可以让搜索数据用流量减少40%，并且支持对以往搜索记录的脱机访问。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411b10d540.png\" alt=\"TIM截图20180413142756.png\" /></p>\r\n<p>Google Go 应用本身只有 5MB 大小，对于低存储空间设备很友好，这款应用也是不意外地有离线模式，主要针对的是网络条件不好地区的用户。除了应用本身的性能优化以外，Google Go 还能显示搜索结果的主题摘要信息，同时也会向用户推荐更多可能会感兴趣的内容，也拥有当前流行趋势主题推荐和语音搜索功能。</p>\r\n<p>Google Go 还可配合 YouTube Go 和文件管理应用 Files Go 使用，该应用将在 Android Oreo（ Go Edition ）设备中预装进行分发，让非洲等新兴市场的消费者得到更流畅、更便捷的 Android 系统体验。</p>', '', 'domestic', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (21, '<p>尽管已经研发两年多时间，但对于Fuchsia系统Google始终缄口不言。不过今天，公司发表了名为&ldquo;<a href=\"https://fuchsia.googlesource.com/docs/+/master/the-book/\" target=\"_blank\" rel=\"noopener\">The Book</a>&rdquo;的深度解析文档，详细介绍了这款计划取代Android和Chrome OS的操作系统。 目前Android和Chrome OS都是使用Linux内核，不过在最新发布的文档中谷歌明确Fuchsia并非基于Linux内核。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411ab103e0.jpg\" alt=\"google-says-its-upcoming-fuchsia-os-is-not-linux-uses-zircon-kernel-520641-2.jpg\" /></p>\r\n<p>根据公布的文档，Fuchsia是基于功能的模块化系统，使用名为&ldquo;Zircon&rdquo;（锆石）的内核，该微内核为Fuchsia系统提供核心驱动以及C Library（libc）实例。</p>\r\n<p>虽然文档仍未完成，但是我们也注意到Google正在打造的Fuchsia OS非常独特，极具创新且前途无限。这款系统从头构建自己的库和组件，通过POSIX向后兼容性和使用基于Vulkan的驱动打造出类UNIX系统。</p>\r\n<p>Fuchsia系统使用名为&ldquo;Escher&rdquo;的物理渲染器，提供物体的Soft Shadows，镜头特效、光影扩散和色彩外溢等功能。此外Fuchsia的文件系统完全在用户空间之间进行操作，并没有链接或者加载到内核中。</p>\r\n<p>在文档中写道：&ldquo;Fuchsia的文件系统本身可以很容易的进行更改--修改不需要重新编译内核。事实上，对Fuchsia的文件系统更新可以不需要重启。&rdquo;</p>', '', 'domestic', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (22, '<p>谷歌手机应用程序在2月份收到了主要更新，为快速通话控件添加了便捷的聊天功能。<strong>在接下来的几周里，Pixel，Nexus和Android One设备的默认拨号程序正在添加垃圾邮件过滤功能，并附带一个新的测试版程序，现在就可以试用该功能。</strong></p>\r\n<p>2016年，该应用程序开始通过将来电屏幕以鲜红色闪烁，并通过电话号码下方的另一个&ldquo;怀疑垃圾邮件来电者&rdquo;警报来提醒用户潜在的垃圾邮件来电者。现在，测试中新的垃圾邮件过滤功能更进一步增强，不再打扰用户。当检测到潜在的垃圾邮件呼叫时，将直接把它发送到语音邮件。因此，手机不会响铃，用户也不会被打搅。</p>\r\n<p>同时，用户不会收到未接电话或语音邮件通知，但已过滤的电话将出现在通话记录中，并且任何留下的语音邮件仍将显示在相应的选项卡中。此功能将在未来几周内在全球范围内推出，但加入新版测试户可以率先使用该功能。和其他程序一样，Google指出允许用户在发布之前使用这种实验性功能。</p>\r\n<p>谷歌警告说，功能仍然在开发中，可能不稳定，并且存在&ldquo;一些问题&rdquo;。同时，用户将需要有能力在整个过程中提交应用内反馈。想要参与测试的用户可以前往电话应用的Google Play列表，然后向下滚动到&ldquo;成为测试人员&rdquo;以加入。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411a368920.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4411a76c4f1.jpg\" /></p>', '', 'domestic', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (24, '<p>谷歌正在与美国医学协会（美国的一个医师游说团体）进行合作，双方达成一项挑战计划，其内容是让初创企业能够想出&ldquo;促进健康监测设备数据共享的最佳新思路&rdquo;。美国医学协会于周一表示，最终的挑战成果将会是一款手机应用或可穿戴设备。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44119d944a0.png\" /></p>\r\n<p>这两者可以让慢性病患者更轻松地与医生分享数据。</p>\r\n<div id=\"cbhahaha\" class=\"otherContent_01\">&nbsp;</div>\r\n<p>该声明称：&ldquo;获奖作品将展示申请人是如何通过病人的健康数据，借助有效的方式，改善医生工作流程临床效果、降低医疗保健系统成本的。&rdquo;</p>\r\n<p>为了在3万亿美元的医疗保健市场中分得一杯羹，一些科技巨头对于医疗保健该行业的公司展开跨界合作显示出越来越强烈的意向，以促进创新。</p>\r\n<p>&nbsp;</p>\r\n<p>去年，亚马逊公司与默克公司共同发起了一项创新挑战计划，以鼓励Alexa的开发人员们提出新的&ldquo;技能&rdquo;，以帮助在家中接受治疗以及医院中接受治疗的糖尿病患者。</p>\r\n<p>亚马逊并没有过多透露其意图，但CNBC在3月份报道了该公司下一步的宏伟目标：针对老龄人口发展其技术。与年轻人相比，老年人在不同程度上更容易罹患糖尿病等慢性病。</p>\r\n<p>Alphabet选择将本次挑战计划集中在医疗数据的互操作性问题上。这样做的目的，是让患者和提供者能够更容易以计算机可读的格式（而不是PDF格式）共享实验室结果或医学成像这样的数据。从历史角度看，许多医院和他们的技术供应商都倾向于选择将病人&ldquo;锁定&rdquo;到他们独家的设备上，而不是为病人提供便捷的数据访问服务。</p>\r\n<p>值得一提的是，苹果公司也正在通过其医疗记录产品来解决这个问题。</p>\r\n<p>本次&ldquo;谷歌&mdash;&mdash;美国医疗协会&rdquo;挑战赛最终将会产生出3个最佳创意，来共同分享5万美元的谷歌云奖金。</p>', '', 'domestic', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (25, '<p>最近 Google 在帮助开发者提升 App 可用性上可谓是动作频频，不只发布了无障碍技术指导方案，成立无障碍支援团队，近日还在<a href=\"https://opensource.googleblog.com/2018/03/open-sourcing-gtxilib-accessibility.html\" target=\"_blank\" rel=\"noopener\">博客上宣布</a>开源&nbsp;iOS&nbsp;专用的自动化测试框架 GTXiLib ，以帮助开发者打造无障碍 App 。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad441196ddc60.png\" alt=\"logo_accessibility_checker_color_3x_ios_133in167dp.png\" /></p>\r\n<p>GTXiLib&nbsp;采用&nbsp;Objective-C&nbsp;编写，能与现存的 XCTest 测试框架整合，并在 XCTest 结束调用 tearDown 前，执行所有注册的可用性检查。当 GTXiLib 检测失败时，XCTest 的测试也会失败，两者相辅相成，能够更好地修补和发现问题。</p>\r\n<p>GTXiLib&nbsp;可用于：</p>\r\n<ul class=\" list-paddingleft-2\">\r\n<li>\r\n<p><strong>重用测试：</strong>&nbsp;GTXiLib 集成整合到现有的功能测试流程中，能大幅提升现有测试价值。</p>\r\n</li>\r\n<li>\r\n<p><strong>增量可访问性测试：</strong>&nbsp;GTXiLib 可安装在单一测试用例、测试类或测试的特定子集上，以允许灵活地增加可访问性测试。</p>\r\n</li>\r\n<li>\r\n<p><strong>编写属于自己的检查：</strong>&nbsp;GTXiLib 有一个简单的 API 来根据你的应用的特定需求创建自定义检查。比如，可以检测应用中的每一个按钮是否都具备 accessibilityHint 属性。</p>\r\n</li>\r\n</ul>\r\n<p>Google&nbsp;还表示，为了改进 GTXiLib ，该框架会收集一些使用数据上传至 Google Analytics ，像是测试应用通过或失败的状态，以及应用绑定 ID的 MD5 哈希值，这些信息会让 Google 知道 GTXiLib 的使用情况。若是用户不愿意，则可以选择添加代码片段来停用 Google Analytics 。</p>\r\n<p>相关链接</p>\r\n<ul class=\" list-paddingleft-2\">\r\n<li>\r\n<p>GTXiLib 的详细介绍：<a href=\"https://www.oschina.net/p/gtxilib\" target=\"_blank\" rel=\"noopener\">点击查看</a></p>\r\n</li>\r\n<li>\r\n<p>GTXiLib 的下载地址：<a href=\"https://www.oschina.net/home/login?goto_page=https%3A%2F%2Fwww.oschina.net%2Fnews%2F94948%2Fgoogle-opensource-gtxilib\" target=\"_blank\" rel=\"noopener\">点击下载</a></p>\r\n</li>\r\n</ul>', '', 'domestic', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (26, '<p><strong>Let\'s Encrypt 宣布 ACME v2 正式支持通配符证书。Let\'s Encrypt 宣称将继续清除 Web 上采用 HTTPS 的障碍，让每个网站轻松获取管理证书。</strong>ACMEv21.6k 是 ACME 协议的更新版本，考虑到行业专家和其他组织可能希望在某天使用 ACME 协议进行证书颁发和管理，它已经通过 IETF 标准流程。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44119326fd0.jpg\" alt=\"Wildcard_certificate.jpg\" /></p>\r\n<p>（配图来自：维基百科）</p>\r\n<p><a href=\"https://en.wikipedia.org/wiki/Wildcard_certificate\" target=\"_self\">Wildcard certificates</a>&nbsp;1.9k&nbsp;允许使用单个证书来保护域的所有子域。在某些情况下，通配符证书可以使证书更容易管理，以帮助使 Web 达到100％ 的 HTTPS 协议。但是对于大多数用例，Let\'s Encrypt 仍然推荐使用非通配符证书。</p>\r\n<p>通配符证书只能通过&nbsp;<a href=\"https://github.com/ietf-wg-acme/acme\" target=\"_self\">ACME</a>v2 获得。为了将 ACMEv2 用于通配符或非通配符证书，你需要一个已更新且支持 ACMEv23.5k 的客户端。Let\'s Encrypt 希望所有客户和订户转换为 ACMEv2，尽管 ACMEv1 API 还没有&ldquo;报废&rdquo;。</p>\r\n<p>另外，通配符域必须使用 DNS-01 质询类型进行验证。这表明你需要修改 DNS TXT 记录才能演示对域的控制以获得通配符证书。</p>\r\n<p>[via&nbsp;<a href=\"https://arstechnica.com/information-technology/2018/03/lets-encrypt-takes-free-wildcard-certificates-live/\" target=\"_self\">ArsTechnica</a>]</p>', '', 'domestic', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (27, '<p><strong>欧洲电力传输系统运营商网络（ENTSOE）是建立内部能源市场并确保其最佳运作的机构，为解释欧洲的电子钟表运行缓慢超过一个月的原因发表了一份声明。</strong>在一篇引人入胜的题为&ldquo;欧洲大陆的频率偏差对频率控制的电子钟表影响&rdquo;新闻稿中，该组织解释说，频率偏差导致一些数字时钟滞后。</p>\r\n<p>许多数字时钟，主要是那些数字闹钟，烤箱和微波炉，使用电网的频率来保持时间。欧洲的电网运行稳定在50Hz，所有时钟都在计算电源周期。如果频率持续下降一段时间，这就造成电子钟表运行缓慢，这种问题在欧洲似乎已经发生。</p>\r\n<p>根据维基百科，频率随着电网负载而变化，但每24小时的周期数保持严格恒定，以使这些电子时钟保持长时间准确。ENTSOE表示，供应短缺是由东南欧的一个未指定的电力分销商造成的。由于欧洲电网相互连接，自1月中旬以来，这导致整个大陆出现频率问题，这些问题导致钟表回落至五分钟。</p>\r\n<p>在问题解决之前，重置你的时钟几乎是不值得的，因为它们只会滞后。 ENTSOE声明确实承诺欧洲的传输系统运营商为了让时钟恢复正常运行，将实施补偿计划，以纠正未来的时间，，需要多长时间仍然不得而知。与此同时，用户仍然可以依赖任何不联网的石英钟，或者通常通过互联网保持正确时间的电脑，智能手机时钟来查看时间。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44118ca9c40.jpg\" alt=\"1024px-Digital-clock-alarm-796x562.jpg\" /></p>', '', 'domestic', 'vr');
INSERT INTO `zb_cms_addonnews` VALUES (30, '<p>北京时间4月11日早间消息，谷歌母公司Alphabet有望在2018进行新的投资，目前，该公司仍在研究如何优化电池的存储价值。作为世界上风能和太阳能的最大企业买家，谷歌可能很快要进行一项新的清洁能源投资，这次他们锁定的目标是电池。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4412a357f60.jpg\" alt=\"Solarpanel.jpg\" /></p>\r\n<p>资料图</p>\r\n<p>本周二，Alphabet公司能源策略主管奈哈&middot;帕尔默（Neha Palmer）在纽约彭博新能源财经机构举办的未来能源峰会上接受采访时说，&ldquo;2018年我们想有所作为，我们正在对几个项目展开调研。&rdquo;</p>\r\n<p>帕尔默指出，谷歌根据几个选项来决定合理的投资方向。其中一些项目包括：独立的可供给电网的电池场；用于家庭或企业的电表后端设备；一套与太阳能或风力发电场相连的系统。</p>\r\n<p>这一项目需要依靠一项长达数年的供应合同来保证营收，该公司仍在审查这种投资的市场需求。帕尔默说：&ldquo;决策团队尚未搞清楚如何优化电力储存的价值。&rdquo;</p>', NULL, 'domestic', 'ar');
