INSERT INTO `zb_cms_addonnews` VALUES (33, '<p>据外媒报道，去年，GitHub 向安全研究人员支付了总计 166495 美元的奖励，针对&nbsp;GitHub 这个为期四年的&ldquo;漏洞赏金&rdquo;项目，安全研究人员会上报自己发现的系统问题和漏洞。2016 年，GitHub 一共支付了81.7万美元，而去年的支出总额显然已经翻了一倍多，几乎相当于前三年的总支出（17.7万美元）。在 2014 和 2015 两年时间里，他们一共支付了95.3万美元的奖金。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4412a798700.jpg\" /></p>\r\n<p>2017 年，GitHub 一共收到了 840 份漏洞报告意见书，但是最终解决问题并获得奖金的比例只有15%（约121份）。2016年，GitHub 共收到了 795 份漏洞报告意见书，最终获得奖励的只有 73 份，而其中只有 48 份有效报告最终被罗列在了漏洞赏金项目的主页上。</p>\r\n<p>有效报告的数量上升推动了总支出的增加，也导致了 GitHub 在去年十月重新评估其支付结构。结果就是，奖金增加了一倍，其中最低奖金为 555 美元，最高奖金高达 20000 美元。</p>\r\n<p>GitHub 的 Greg Ose 指出，随着参与的项目、计划和研究人员规模不断增加，去年是迄今为止支付赏金最多的一年。不仅如此，他们还把 GitHub Enterprise 引入到漏洞赏金项目之中，让研究人员能够在 GitHub.com 平台上一些未公开的、或是特定于某个企业部署的领域里找到漏洞。Ose说道：</p>\r\n<blockquote>\r\n<p>&ldquo;去年年初，很多漏洞报告涉及到了我们的企业认证方法，这也促使我们不得不在内部关注这个问题，而且我们也在研究如何让研究人员也关注这个功能。&rdquo;</p>\r\n</blockquote>\r\n<p>此外，Ose还表示，GitHub 已经发布了首个研究人员捐赠，也是他们长期以来关注的一项举措。这项工作会为挖掘应用程序特定功能或领域的研究人员支付固定金额。当然，其他任何发现漏洞的人也能够通过漏洞赏金项目获得奖励。</p>\r\n<p>去年，GitHub 还推出了私人漏洞补丁服务，让用户能够限制生产漏洞的影响范围。不仅如此，他们还进行了内部改进，以更有效进行漏洞分类和修复提交，并计划在今年进一步完善流程。</p>\r\n<p>现在，GitHub 希望进一步扩大 2017 年所取得成绩，推出更多私人奖励和研究补助金，以便在代码公开发布之前及之后引起大家的关注。该公司还计划在今年晚些时候，推出额外的奖励计划。Ose总结道：</p>\r\n<blockquote>\r\n<p>&ldquo;鉴于漏洞赏金项目取得了成功，我们现在正考虑如何扩大其范围，为我们的生产服务提供更多帮助，同时保护整个GitHub生态系统。我们很期待下一步工作，并且会在今年对提交的漏洞内容进行分类和修正。&rdquo;</p>\r\n</blockquote>', 'cnbeta1', 'overseas', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (34, '<p>本周我们正在研究Leap Motion为增强现实带来的新东西。<strong>我们已经看到他们之前创造了一些令人难以置信的技术，尤其是当涉及到运动跟踪和控制时。现在看起来他们认为他们是以面向优先的方式进入AR增强现实世界。</strong></p>\r\n<p>Leap Motion有一款在性能和外形之间达到平衡的头显，这款头显达到了Leap Motion所说最高技术规格所在的平衡点。换句话说，他们创造了一款人们可以使用的产品，与当今世界上大多数其他消费类产品不同。</p>\r\n<p>为了制造这款头显，Leap Motion的团队使用了几款5.5英寸的智能手机。他们将这些智能手机放在佩戴者脸部的两侧，并将其内部的图像反映出来。通过这种设置，最终他们发现他们需要创建自己的LED显示系统。他们决定采用Analogix显示驱动器和两个&ldquo;快速切换&rdquo;BOE 3.5英寸显示屏的架构。</p>\r\n<p>他们已经创造了一款头显，正如他们所描述的那样，它会让所有其他头显（VR，AR等）感到羞耻。两个120 fps，1600x1440显示屏，100+视角范围和150 fps手动追踪180 x 180度FOV，打开这个头显，当今系统的分辨率，等待时间和视野限制就会消失。</p>\r\n<p>那么你可以在哪里购买这种现代技术的奇迹？你不能。目前，Leap Motion将此项目称为&ldquo;北极星计划&rdquo;，并将其作为一个跳板点。他们正在使用这个项目来表明我们所有人都关注于AR硬件是错误的，他们的产品可以带来最佳体验。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44129495250.jpg\" /></p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44129bb3621.png\" /></p>', 'ks', 'domestic', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (35, '<p>据外媒报道，研究人员正在利用VR技术帮助教师们了解自闭症学s生进而能够真正地去帮助他们。近日，来自马耳他大学的一个研究小组决定通过VR技术帮助教师理解自闭症儿童的生活体验。通过利用自闭症儿童的音频和视觉技巧，研究团队开发出一个VR应用，它能模拟出自闭症儿童在教室里的体验情况。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44128db3ed0.png\" alt=\"austim.png\" /></p>\r\n<p>参与了软件开发工作的马耳他大学人工智能系讲师Vanessa Camilleri博士表示，他们希望让教师走进自闭症儿童的世界里了解他们的真实情况同时也希望VR能够成为一台同理心机器。与此同时，他们还希望能从中学到更多的东西进而能设计出能帮助改善自闭症儿童生活质量的工具。</p>\r\n<p>实际上将VR作为一种共情工具的想法已经存在一段时间了。电影制作人Chris Milk就曾和联合国联合制作过一部展示叙利亚难民营生活的VR影片《Clouds Over Sidra》。</p>\r\n<p>目前，研究小组的这款软件还不能使用，但他们希望未来能通过Samsung Gear头套让教师们用上它。</p>\r\n<p>Camilleri还强调，该项目并不能做到模拟出自闭症儿童的各个方面，如嗅觉、触觉。另外他还表示，他们开发的应用更多的是让老师们去了解他们的学生而不是教授他们如何去帮助自闭症学生。</p>\r\n<p>获悉，该团队希望最终还能为父母或家庭成员开发出另一个不同版本的同类型软件。</p>', 'cnbeta', 'domestic', 'ar');
INSERT INTO `zb_cms_addonnews` VALUES (36, '<p>让她任天野让他让他<img src=\"/uploads/20180921/3af564c327a47e15e054ad4de56648e2.png\" data-filename=\"filename\" style=\"width: 52px;\"></p>', '', 'domestic', 'vr');
INSERT INTO `zb_cms_addonproduct` VALUES (18, '<p>据外媒报道，去年，GitHub 向安全研究人员支付了总计 166495 美元的奖励，针对&nbsp;GitHub 这个为期四年的&ldquo;漏洞赏金&rdquo;项目，安全研究人员会上报自己发现的系统问题和漏洞。2016 年，GitHub 一共支付了81.7万美元，而去年的支出总额显然已经翻了一倍多，几乎相当于前三年的总支出（17.7万美元）。在 2014 和 2015 两年时间里，他们一共支付了95.3万美元的奖金。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4412a798700.jpg\" /></p>\r\n<p>2017 年，GitHub 一共收到了 840 份漏洞报告意见书，但是最终解决问题并获得奖金的比例只有15%（约121份）。2016年，GitHub 共收到了 795 份漏洞报告意见书，最终获得奖励的只有 73 份，而其中只有 48 份有效报告最终被罗列在了漏洞赏金项目的主页上。</p>\r\n<p>有效报告的数量上升推动了总支出的增加，也导致了 GitHub 在去年十月重新评估其支付结构。结果就是，奖金增加了一倍，其中最低奖金为 555 美元，最高奖金高达 20000 美元。</p>\r\n<p>GitHub 的 Greg Ose 指出，随着参与的项目、计划和研究人员规模不断增加，去年是迄今为止支付赏金最多的一年。不仅如此，他们还把 GitHub Enterprise 引入到漏洞赏金项目之中，让研究人员能够在 GitHub.com 平台上一些未公开的、或是特定于某个企业部署的领域里找到漏洞。Ose说道：</p>\r\n<blockquote>\r\n<p>&ldquo;去年年初，很多漏洞报告涉及到了我们的企业认证方法，这也促使我们不得不在内部关注这个问题，而且我们也在研究如何让研究人员也关注这个功能。&rdquo;</p>\r\n</blockquote>\r\n<p>此外，Ose还表示，GitHub 已经发布了首个研究人员捐赠，也是他们长期以来关注的一项举措。这项工作会为挖掘应用程序特定功能或领域的研究人员支付固定金额。当然，其他任何发现漏洞的人也能够通过漏洞赏金项目获得奖励。</p>\r\n<p>去年，GitHub 还推出了私人漏洞补丁服务，让用户能够限制生产漏洞的影响范围。不仅如此，他们还进行了内部改进，以更有效进行漏洞分类和修复提交，并计划在今年进一步完善流程。</p>\r\n<p>现在，GitHub 希望进一步扩大 2017 年所取得成绩，推出更多私人奖励和研究补助金，以便在代码公开发布之前及之后引起大家的关注。该公司还计划在今年晚些时候，推出额外的奖励计划。Ose总结道：</p>\r\n<blockquote>\r\n<p>&ldquo;鉴于漏洞赏金项目取得了成功，我们现在正考虑如何扩大其范围，为我们的生产服务提供更多帮助，同时保护整个GitHub生态系统。我们很期待下一步工作，并且会在今年对提交的漏洞内容进行分类和修正。&rdquo;</p>\r\n</blockquote>', 'https://cdn.fastadmin.net/uploads/20180401/1f059faa0ba3bb502d7dd012565321e2.jpg,https://cdn.fastadmin.net/uploads/20180401/05e374fd1f784f9c4f634889bd7028ac.jpg,https://cdn.fastadmin.net/uploads/20180401/fdaca158bf96ed0fd59879f2c7f673d3.jpg,https://cdn.fastadmin.net/uploads/20180401/33b63f123cdee4c251590b73c2464fa9.jpg');
INSERT INTO `zb_cms_addonproduct` VALUES (23, '<p>北京时间4月11日早间消息，谷歌母公司Alphabet有望在2018进行新的投资，目前，该公司仍在研究如何优化电池的存储价值。作为世界上风能和太阳能的最大企业买家，谷歌可能很快要进行一项新的清洁能源投资，这次他们锁定的目标是电池。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad4412a357f60.jpg\" alt=\"Solarpanel.jpg\" /></p>\r\n<p>资料图</p>\r\n<p>本周二，Alphabet公司能源策略主管奈哈&middot;帕尔默（Neha Palmer）在纽约彭博新能源财经机构举办的未来能源峰会上接受采访时说，&ldquo;2018年我们想有所作为，我们正在对几个项目展开调研。&rdquo;</p>\r\n<p>帕尔默指出，谷歌根据几个选项来决定合理的投资方向。其中一些项目包括：独立的可供给电网的电池场；用于家庭或企业的电表后端设备；一套与太阳能或风力发电场相连的系统。</p>\r\n<p>这一项目需要依靠一项长达数年的供应合同来保证营收，该公司仍在审查这种投资的市场需求。帕尔默说：&ldquo;决策团队尚未搞清楚如何优化电力储存的价值。&rdquo;</p>', 'https://cdn.fastadmin.net/uploads/20180416/5ad4412a357f60.jpg,https://cdn.fastadmin.net/uploads/20180404/9dcbcd9ca1fce9f184ee12aea36351de.jpg,https://cdn.fastadmin.net/uploads/20180401/e5f3f6312c360f4c851daf99b1208515.jpg,https://cdn.fastadmin.net/uploads/20180401/26558a3bffe6960768350f2202885955.jpg,https://cdn.fastadmin.net/uploads/20180401/2d184becba222eb8406aadd72b004c5e.jpg,https://cdn.fastadmin.net/uploads/20180401/8cb318ead26ae66086953f1c0bcf0275.jpg');
INSERT INTO `zb_cms_addonproduct` VALUES (28, '<p>本周我们正在研究Leap Motion为增强现实带来的新东西。<strong>我们已经看到他们之前创造了一些令人难以置信的技术，尤其是当涉及到运动跟踪和控制时。现在看起来他们认为他们是以面向优先的方式进入AR增强现实世界。</strong></p>\r\n<p>Leap Motion有一款在性能和外形之间达到平衡的头显，这款头显达到了Leap Motion所说最高技术规格所在的平衡点。换句话说，他们创造了一款人们可以使用的产品，与当今世界上大多数其他消费类产品不同。</p>\r\n<p>为了制造这款头显，Leap Motion的团队使用了几款5.5英寸的智能手机。他们将这些智能手机放在佩戴者脸部的两侧，并将其内部的图像反映出来。通过这种设置，最终他们发现他们需要创建自己的LED显示系统。他们决定采用Analogix显示驱动器和两个&ldquo;快速切换&rdquo;BOE 3.5英寸显示屏的架构。</p>\r\n<p>他们已经创造了一款头显，正如他们所描述的那样，它会让所有其他头显（VR，AR等）感到羞耻。两个120 fps，1600x1440显示屏，100+视角范围和150 fps手动追踪180 x 180度FOV，打开这个头显，当今系统的分辨率，等待时间和视野限制就会消失。</p>\r\n<p>那么你可以在哪里购买这种现代技术的奇迹？你不能。目前，Leap Motion将此项目称为&ldquo;北极星计划&rdquo;，并将其作为一个跳板点。他们正在使用这个项目来表明我们所有人都关注于AR硬件是错误的，他们的产品可以带来最佳体验。</p>\r\n<p><a href=\"https://static.cnbetacdn.com/article/2018/0410/bd9058b4bbe7a4c.jpg\" target=\"_blank\" rel=\"noopener\" data-index=\"0\" data-lightbox-gallery=\"cbc-gallery\"><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44129495250.jpg\" /></a></p>\r\n<p><a href=\"https://static.cnbetacdn.com/article/2018/0410/e4a1b9dfd59d1ae.png\" target=\"_blank\" rel=\"noopener\" data-index=\"1\" data-lightbox-gallery=\"cbc-gallery\"><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44129bb3621.png\" /></a></p>', 'https://cdn.fastadmin.net/uploads/20180416/5ad44129495250.jpg');
INSERT INTO `zb_cms_addonproduct` VALUES (29, '<p>据外媒报道，研究人员正在利用VR技术帮助教师们了解自闭症学生进而能够真正地去帮助他们。近日，来自马耳他大学的一个研究小组决定通过VR技术帮助教师理解自闭症儿童的生活体验。通过利用自闭症儿童的音频和视觉技巧，研究团队开发出一个VR应用，它能模拟出自闭症儿童在教室里的体验情况。</p>\r\n<p><img src=\"https://cdn.fastadmin.net/uploads/20180416/5ad44128db3ed0.png\" alt=\"austim.png\" /></p>\r\n<p>参与了软件开发工作的马耳他大学人工智能系讲师Vanessa Camilleri博士表示，他们希望让教师走进自闭症儿童的世界里了解他们的真实情况同时也希望VR能够成为一台同理心机器。与此同时，他们还希望能从中学到更多的东西进而能设计出能帮助改善自闭症儿童生活质量的工具。</p>\r\n<p>实际上将VR作为一种共情工具的想法已经存在一段时间了。电影制作人Chris Milk就曾和联合国联合制作过一部展示叙利亚难民营生活的VR影片《Clouds Over Sidra》。</p>\r\n<p>目前，研究小组的这款软件还不能使用，但他们希望未来能通过Samsung Gear头套让教师们用上它。</p>\r\n<p>Camilleri还强调，该项目并不能做到模拟出自闭症儿童的各个方面，如嗅觉、触觉。另外他还表示，他们开发的应用更多的是让老师们去了解他们的学生而不是教授他们如何去帮助自闭症学生。</p>\r\n<p>获悉，该团队希望最终还能为父母或家庭成员开发出另一个不同版本的同类型软件。</p>', 'https://cdn.fastadmin.net/uploads/20180416/5ad44128db3ed0.png');
INSERT INTO `zb_cms_archives` VALUES (1, 7, 1, '驰为发布HiGame迷你PC新品 小身材大能量', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4412814b010.jpg', '驰为,笔记本,HiGame', '说到驰为（Chuwi），很多人第一时间想到的就是该公司的 Windows 笔记本或 Android 平板电脑。但是最近，该厂家又凭借 HiGame 子品牌进军了迷你游戏 PC 市场。作为一款迷你 PC，它的三围只有 17.3×15.8×7.3 CM（约 7×6×3 英寸）。即便如此，它的硬件配置也让我们眼前一亮。', 'HiGame,PC,驰为', 1, 11, 1, 0, 0, '', 1523718809, 1523879174, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (2, 7, 1, '宏碁Chromebox CXI3迷你台式机现已开放预定', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44127cc3810.jpg', '宏基,台式机', '今年 1 月的时候，宏碁（Acer）发布了多款新产品，其中就包括 Chromebox CXI3 。与 Chromebook 笔记本不同，Chromebox CXI3 是一款运行 Chrome OS 的小型台式机。不占地方，显然是它的最大卖点，用户甚至可以将它背挂到显示器后面。如果你想要拥有一台，那么现在宏碁也已经开放预定了。', 'Chromebox,台式机,宏基', 2, 20, 0, 0, 0, '', 1523718936, 1523879158, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (3, 7, 1, 'Misfit最新的混合动力手表Path现已上市', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44125f364e0.png', '手表,混合动力', 'Misfit的混合动力手表今天通过公司网站发售。它的售价为149.99美元，将有四种颜色可供选择：不锈钢，玫瑰金，黄金和带金色调的不锈钢。该公司首先在CES首次推出手表，在那里我们看到了这款小巧的新设备。这是该公司最小的手表 -  38毫米 - 并没有触摸屏，但它通过蓝牙与智能手机配对。', '智能手表,混合动力', 3, 2, 0, 0, 0, '', 1523719020, 1523879142, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (4, 7, 1, 'UE为现场演出者推出了价值2200美元的舞台耳返设备', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad441258ab510.png', '耳返,智能设备', '大多数消费者可能熟悉UE推出的色彩鲜艳的蓝牙音箱，但该公司也有一系列定制入耳式耳机，UE刚刚推出了一款新的顶级旗舰机型：2,200美元的UE Live。UE Live耳机是该公司以前的旗舰UE18 Pro型号的进化版本，将每个耳机的扬声器数量从6个增加到8个，共计6个平衡电枢，一个True Tone Plus驱动器和一个6mm钕制动态扬声器，以提供更好的声音。', '智能设备,耳返', 4, 3, 0, 1, 0, '', 1523719106, 1523879126, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (5, 7, 1, '南孚推出全球首款测电器装电池：可秒分电池新旧', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4412530fd08.jpg', '电池,南孚', '想必大家都遇到过这样尴尬的事情：家里有很多电池，用的时候也分不清哪个有电、哪个没电，扔了又怕浪费。于是旧的不丢掉，新的买来用，这样家里的电池越积攒越多，造成恶性循环。而现在，南孚带来了一款全新产品——南孚测电器装电池，包含南孚测电器和南孚碱性电池，轻轻松松测一测，电池电量一目了然。', '南孚,电池', 5, 4, 0, 0, 0, '', 1523719198, 1523879107, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (6, 7, 1, '强生将推能根据光线条件自动变色的隐形镜片', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44121af36d0.jpeg', '智能设备,强生', '据外媒报道，多年来，人们已经习惯于使用变色镜片的眼镜，然而这在隐形眼镜中却不存在。不过就在日前，强生终于打破了这个技术壁垒，这家公司宣布即将向市场推出具备变色功能的隐形镜片。', '智能设备', 6, 0, 0, 0, 0, '', 1523719286, 1523879078, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (7, 7, 1, 'Snap新一代Spectacles眼镜文档已被FCC曝光', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44121495860.jpg', '', '据 Variety 报道，FCC 辐射实验室刚刚证实了一副来自 Snap 的新眼镜。今日曝光的这款穿戴设备的文档称，这是一款由 Snap Inc. 制作的穿戴式视频拍摄装置。从印刷标签来看，其品牌名称为 Spectacles，型号为 Model 002 。尽管文件中所附的大部分内容都以保密为由被遮掩，但还是可以知道它支持低功耗蓝牙 4.2 和 802.11ac Wi-Fi 。', '智能设备,眼镜', 7, 3, 0, 1, 0, '', 1523719403, 1523879062, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (8, 5, 1, '投资者需求旺盛 Dropbox将IPO发行价区间调高2美元', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44120f16870.jpg', '', '云存储服务商Dropbox今日宣布，由于投资者需求强劲，现将IPO(数次公开招股)发行价区间调高2美元。上周一，Dropbox宣布将IPO发行价区间定为每股16美元至18美元，最高融资6.48亿美元，公司市值将达到约71亿美元。', 'dropbox,投资', 8, 1, 0, 0, 0, '', 1523719527, 1523879042, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (9, 5, 1, 'Dropbox股价上市首日大涨36% 市值超120亿美元', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44120cd28e0.jpg', '', '著名云存储服务提供商Dropbox在上市交易首日股价大涨36%，开盘定价为21美元每股，在当日最高时达到31.6美元每股，最终以28.48美元每股的价格收盘，现在市值超过120亿美元。可以明显看出公开市场投资者十分看好Dropbox这家主营业务为云存储服务和内容协作平台的公司。Dropbox最先对自己股价的预期是16到18美元每股，后来提升到18到20美元每股。而由于上市交易首日表现出色，超过了2014年私募时100亿美元的估值。', 'dropbox,投资', 9, 0, 0, 0, 0, '', 1523719610, 1523879028, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (10, 5, 1, '云存储公司Dropbox在美提交IPO申请：拟筹资5亿美元', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44120825a50.jpg', '', '云存储公司Dropbox周五向美国证券交易委员会（SEC）提交了IPO（首次公开招股）申请文件，寻求筹集5亿美元资金。Dropbox的IPO交易长期以来备受市场期待，该公司四年前在私募投资市场上的估值就已高达100亿美元。', 'dropbox', 10, 0, 0, 0, 0, '', 1523719716, 1523879000, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (11, 5, 1, '通用电气针对Predix云平台的创业者推出奖励计划', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad441204c1c20.png', '', '通用电气（GE）为推广Predix云平台的应用开发，在国内推出首期\"Predix星火计划\"，以奖励基于该平台的工业互联网开发者。首期有4家企业获奖，将进驻GE孵化器并获得技术支持和潜在投资机会。', '云计算,互联网', 11, 0, 0, 0, 0, '', 1523719810, 1523878981, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (12, 5, 1, '超越Web服务 Cloudflare推出全新的Spectrum安全服务', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411fb836c0.png', '', '据外媒报道，Cloudflare 公司正将其业务拓展到网站和云应用之外的互联网安全领域。此前，Cloudflare 帮助过企业屏蔽恶意流量，并且让它们的线上内容加载得更加迅速。而根据今日披露的内容，这项新服务旨在保护那些在公共网络背景下运行的联网基础设施，涵盖了从企业内部电子邮件服务器、到领域内部署的联网设备等各个方面。', '云计算,安全', 12, 1, 0, 0, 0, '', 1523719980, 1523878966, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (13, 5, 1, '映泰Z390GT5主板手册曝光 英特尔Z390芯片组或即将到来 当', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411ecab1c0.jpg', '', '当英特尔上周推出更多更多 Coffee Lake CPU 和配套主板时，传说中的 Z390 芯片组却意外缺席了。不过有眼尖的人们发现，主板厂商映泰（Biostar）在自家 B360 Racing GT5 手册中，竟然清楚地列明了另一款名叫“Z390GT5”主板的存在。作为一个二线品牌，映泰的产品主打平价而不是古怪的设计。不过它与现有的 Z370 系列没有太大差别，而且最高支持的 CPU TDP 也仅为 95W，刚好够酷睿 i7-8700K 使用而已。', '智能设备', 13, 1, 0, 0, 0, '', 1523720694, 1523878951, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (14, 4, 1, '在数据黑箱和信赖危机面前 谁更应该战战兢兢？', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411e749b30.jpg', '', '4 月 11 日，Valve 宣布旗下著名的 PC 游戏发行平台 Steam 会推出新的用户数据隐私安全措施。今后玩家们可以选择隐藏你的游戏库内容，也可以隐藏你的活动细节，具体到最近收藏什么游戏，买了什么游戏，玩了什么游戏以及在某游戏上花了多少小时等等。', '安全', 14, 1, 0, 0, 0, '', 1523720913, 1523878935, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (15, 4, 1, 'Google Chrome和Mozilla Firefox将支持全新无密码登录规范', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411e3a7db0.png', '', '今天，W3C和FIDO联盟标准机构宣布，Web浏览器正在构建一种新的登录方式。这款名为WebAuthn所呈现的新开放标准将在最新版本的Firefox中得到支持，并将在未来几个月发布的Chrome和Edge的版本中得到支持。这是多年来的最新举措，目的是让用户远离密码，转向更安全的登录方式，如生物识别和USB令牌。', '互联网,安全', 15, 0, 0, 0, 0, '', 1523720991, 1523878915, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (16, 4, 1, 'GitHub 安全警告计划已检测出 400 多万个漏洞', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411db71750.png', '', 'Github 去年推出的安全警告，极大减少了开发人员消除 Ruby 和 JavaScript 项目漏洞的时间。GitHub 安全警告服务，可以搜索依赖寻找已知漏洞然后通过开发者，以便帮助开发者尽可能快的打上补丁修复漏洞，消除有漏洞的依赖或者转到安全版本。', '互联网,安全', 16, 0, 0, 0, 0, '', 1523721095, 1523878887, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (17, 4, 1, 'Windows 10杀毒软件大PK：Defender首入前三', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411cec01d0.jpg', '', 'AV-TEST公布了2018年1~2月杀毒软件的最新测试情况，稍稍有点不接地气的是，基于Windows 10企业版平台。排名第一的依然是铁打的卡巴斯基，3个满分总计18分无悬念。不过，这次Symantec和Trend Micro也是18满分，令人刮目相看。', '云计算,安全', 17, 1, 0, 0, 0, '', 1523721137, 1523878857, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (18, 10, 2, 'GitHub 去年为漏洞支付了 16.6 万美元赏金', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4412a798700.jpg', '', '据外媒报道，去年，GitHub 向安全研究人员支付了总计 166495 美元的奖励，针对 GitHub 这个为期四年的“漏洞赏金”项目，安全研究人员会上报自己发现的系统问题和漏洞。2016 年，GitHub 一共支付了81.7万美元，而去年的支出总额显然已经翻了一倍多，几乎相当于前三年的总支出（17.7万美元）。在 2014 和 2015 两年时间里，他们一共支付了95.3万美元的奖金。', '互联网,安全', 18, 21, 0, 1, 0, '', 1523721203, 1523895458, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (19, 3, 1, '谷歌发布“与书对话”检索引擎 从字里行间邂逅心仪书籍', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411b4c3960.jpg', '', '今日，谷歌分享了 Semantic Experiences，在博客中展示了两大关于自然语言理解的互动工具。Talk to Books 是一个可以从书中的句子层面搜索书籍的全新检索模式；另一个互动内容则是 Semantris，一个由机器学习驱动的单词联想游戏。', 'Google,互联网', 19, 3, 0, 0, 0, '', 1523721303, 1523878822, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (20, 3, 1, '节省40%搜索流量:Google Go轻量级应用将于非洲市场推出', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411b10d540.png', '', '针对新兴市场，Google希望通过Google Go轻量级应用帮助身处网络速度慢、流量资费高昂地区的用户获得更流畅的网络搜索体验。现在谷歌正向在26个撒哈拉以南非洲国家/地区推广，Google Go轻量级应用可以让搜索数据用流量减少40%，并且支持对以往搜索记录的脱机访问。', 'Google,互联网', 20, 0, 0, 0, 0, '', 1523721344, 1523878791, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (21, 3, 1, '谷歌公布Fuchsia文档：并非Linux内核 从头构建自己的库和组件', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411ab103e0.jpg', '', '尽管已经研发两年多时间，但对于Fuchsia系统Google始终缄口不言。不过今天，公司发表了名为“The Book”的深度解析文档，详细介绍了这款计划取代Android和Chrome OS的操作系统。 目前Android和Chrome OS都是使用Linux内核，不过在最新发布的文档中谷歌明确Fuchsia并非基于Linux内核。', 'Google,互联网', 21, 4, 0, 0, 0, '', 1523721408, 1523878779, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (22, 3, 1, '谷歌手机应用可直接过滤语音垃圾邮件', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4411a368920.jpg', '', '谷歌手机应用程序在2月份收到了主要更新，为快速通话控件添加了便捷的聊天功能。在接下来的几周里，Pixel，Nexus和Android One设备的默认拨号程序正在添加垃圾邮件过滤功能，并附带一个新的测试版程序，现在就可以试用该功能。', 'Google,互联网', 22, 3, 0, 0, 0, '', 1523721460, 1523878762, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (23, 10, 2, '谷歌母公司继续投资清洁能源领域：或押注于电池', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4412a357f60.jpg', '', '北京时间4月11日早间消息，谷歌母公司Alphabet有望在2018进行新的投资，目前，该公司仍在研究如何优化电池的存储价值。作为世界上风能和太阳能的最大企业买家，谷歌可能很快要进行一项新的清洁能源投资，这次他们锁定的目标是电池。', 'Google,互联网', 23, 28, 0, 0, 0, '', 1523721500, 1523895423, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (24, 3, 1, '谷歌携手美国医学协会 促进健康监测设备数据共享', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44119d944a0.png', '', '谷歌正在与美国医学协会（美国的一个医师游说团体）进行合作，双方达成一项挑战计划，其内容是让初创企业能够想出“促进健康监测设备数据共享的最佳新思路”。美国医学协会于周一表示，最终的挑战成果将会是一款手机应用或可穿戴设备。', 'Google,互联网', 24, 6, 0, 0, 0, '', 1523721555, 1523878724, 1523635200, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (25, 3, 1, '谷歌开源 iOS 自动测试框架 GTXiLib，主打无障碍使用', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad441196ddc60.png', '', '最近 Google 在帮助开发者提升 App 可用性上可谓是动作频频，不只发布了无障碍技术指导方案，成立无障碍支援团队，近日还在博客上宣布开源 iOS 专用的自动化测试框架 GTXiLib ，以帮助开发者打造无障碍 App 。', 'Google,互联网', 25, 7, 0, 0, 0, '', 1523754040, 1523878710, 1523721600, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (26, 4, 1, 'Let\'s Encrypt发布ACME v2 正式支持通配符证书', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44119326fd0.jpg', '', 'Let\'s Encrypt 宣布 ACME v2 正式支持通配符证书。Let\'s Encrypt 宣称将继续清除 Web 上采用 HTTPS 的障碍，让每个网站轻松获取管理证书。ACMEv21.6k 是 ACME 协议的更新版本，考虑到行业专家和其他组织可能希望在某天使用 ACME 协议进行证书颁发和管理，它已经通过 IETF 标准流程。', '互联网,安全', 26, 36, 0, 1, 0, '', 1523754142, 1523878676, 1523721600, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (27, 4, 1, '因为电网问题 欧洲的电子钟表运行缓慢超过一个月时间', 'recommend', 'https://cdn.fastadmin.net/uploads/20180416/5ad44118ca9c40.jpg', '', '欧洲电力传输系统运营商网络（ENTSOE）是建立内部能源市场并确保其最佳运作的机构，为解释欧洲的电子钟表运行缓慢超过一个月的原因发表了一份声明。在一篇引人入胜的题为“欧洲大陆的频率偏差对频率控制的电子钟表影响”新闻稿中，该组织解释说，频率偏差导致一些数字时钟滞后。', '互联网,安全', 27, 146, 7, 1, 1, '', 1523754196, 1523878659, 1523721600, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (28, 9, 2, 'Leap Motion AR头显看起来很疯狂但可能是奇迹', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44129495250.jpg', '', '本周我们正在研究Leap Motion为增强现实带来的新东西。我们已经看到他们之前创造了一些令人难以置信的技术，尤其是当涉及到运动跟踪和控制时。现在看起来他们认为他们是以面向优先的方式进入AR增强现实世界。', 'AR,VR,互联网', 28, 17, 0, 1, 0, '', 1523755374, 1523878629, 1523721600, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (29, 9, 2, '研究人员利用VR技术帮助教师更好了解自闭症学生', 'hot,new', 'https://cdn.fastadmin.net/uploads/20180416/5ad44128db3ed0.png', '', '据外媒报道，研究人员正在利用VR技术帮助教师们了解自闭症学生进而能够真正地去帮助他们。近日，来自马耳他大学的一个研究小组决定通过VR技术帮助教师理解自闭症儿童的生活体验。通过利用自闭症儿童的音频和视觉技巧，研究团队开发出一个VR应用，它能模拟出自闭症儿童在教室里的体验情况。', 'AR,互联网', 29, 34, 0, 0, 1, '', 1523755471, 1523878608, 1523721600, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (30, 3, 1, '谷歌母公司继续投资清洁能源领域：或押注于电池', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4412a357f60.jpg', '', '', '互联网,Google', 30, 7, 0, 0, 0, '', 1523895691, 1523895691, 1523894400, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (33, 3, 1, 'GitHub 去年为漏洞支付了 16.6 万美元赏金', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad4412a798700.jpg', '', '据外媒报道，去年，GitHub 向安全研究人员支付了总计 166495 美元的奖励，针对 GitHub 这个为期四年的“漏洞赏金”项目，安全研究人员会上报自己发现的系统问题和漏洞。2016 年，GitHub 一共支付了81.7万美元，而去年的支出总额显然已经翻了一倍多，几乎相当于前三年的总支出（17.7万美元）。在 2014 和 2015 两年时间里，他们一共支付了95.3万美元的奖金。', '互联网,安全', 33, 17, 0, 1, 1, '', 1523895893, 1523895893, 1523894400, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (34, 7, 1, 'Leap Motion AR头显看起来很疯狂但可能是奇迹', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44129495250.jpg', '', '本周我们正在研究Leap Motion为增强现实带来的新东西。我们已经看到他们之前创造了一些令人难以置信的技术，尤其是当涉及到运动跟踪和控制时。现在看起来他们认为他们是以面向优先的方式进入AR增强现实世界。', '互联网,AR', 34, 30, 0, 2, 0, '', 1523895990, 1523895990, 1523894400, NULL, 'normal');
INSERT INTO `zb_cms_archives` VALUES (35, 7, 1, '研究人员利用VR技术帮助教师更好了解自闭症学生', '', 'https://cdn.fastadmin.net/uploads/20180416/5ad44128db3ed0.png', '', '据外媒报道，研究人员正在利用VR技术帮助教师们了解自闭症学生进而能够真正地去帮助他们。近日，来自马耳他大学的一个研究小组决定通过VR技术帮助教师理解自闭症儿童的生活体验。通过利用自闭症儿童的音频和视觉技巧，研究团队开发出一个VR应用，它能模拟出自闭症儿童在教室里的体验情况。', '智能设备,AR', 35, 160, 1, 20, 14, '', 1523896040, 1523896040, 1523894400, NULL, 'normal');
