  `keys` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT '关键词',
  `dc` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL,
  `logoimage` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT 'logo',
  `icoimage` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT 'ico',
  `bgimage` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '背景',
  `ewmimage` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '二维码',
  `regban` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT '注册过滤',
  `msgban` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT '聊天过滤',
  `state` enum('2','1','0') CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '系统状态:0=关闭,1=开启,2=加密',
  `pwd` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '密码',
  `regaudit` enum('1','0') CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '注册审核:0=否,1=是',
  `msgblock` enum('1','0') CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '消息屏蔽:0=否,1=是',
  `msgaudit` enum('1','0') CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '消息审核:0=否,1=是',
  `msglog` enum('1','0') CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '消息记录:0=否,1=是',
  `logintip` enum('1','0') CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '登陆提示:0=否,1=是',
  `loginguest` enum('1','0') CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '游客登陆:0=否,1=是',
  `copyright` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT '版权设置',
  `tserver` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '文字服务器',
  `vserver` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '视频服务器',
  `livetype` enum('1','0') CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '直播类型:0=转播,1=直播',
  `online` int(11) NULL DEFAULT 0,
  `defvideo` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL,
  `phonefp` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT '手机直播',
  `livefp` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT 'pc直播',
  `rebots` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '机器人数量',
  `defkf` varchar(30) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '默认客服',
  `defvideonick` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '默认讲师',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci COMMENT = '直播间配置' ROW_FORMAT = Dynamic;

